CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_actualizar_progreso` (IN `p_id_alumno` INT, IN `p_id_curso` INT, IN `p_nivel_actual` INT)   BEGIN
    INSERT INTO progreso_curso (id_alumno, id_curso, nivel_actual)
    VALUES (p_id_alumno, p_id_curso, p_nivel_actual)
    ON DUPLICATE KEY UPDATE 
        nivel_actual = p_nivel_actual,
        ultima_fecha = CURRENT_TIMESTAMP;
        
    -- Mark as completed if reached final level
    UPDATE progreso_curso pc
    SET pc.completado = true 
    WHERE pc.id_alumno = p_id_alumno 
    AND pc.id_curso = p_id_curso
    AND pc.nivel_actual >= (SELECT COUNT(*) FROM nivelesCurso WHERE id_curso = p_id_curso);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_agregar_categoria` (IN `p_nombre` VARCHAR(100), IN `p_descripcion` TEXT)   BEGIN
    -- Verificar si el nombre ya existe
    IF NOT EXISTS (
        SELECT 1
        FROM categoria
        WHERE nombre = p_nombre
    ) THEN
        -- Insertar la nueva categoría
        INSERT INTO categoria (nombre, descripcion)
        VALUES (p_nombre, p_descripcion);
    ELSE
        -- Mensaje de error si el nombre ya existe (opcional)
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'El nombre de la categoría ya existe.';
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_agregar_comentario` (IN `p_id_alumno` INT, IN `p_id_curso` INT, IN `p_texto` TEXT, IN `p_calificacion` INT)   BEGIN
    
    IF p_calificacion < 1 OR p_calificacion > 5 THEN
        SIGNAL SQLSTATE '45000'
        SET MESSAGE_TEXT = 'La calificación debe estar entre 1 y 5';
    ELSE
        INSERT INTO comentario (id_alumno, id_curso, texto, calificacion)
        VALUES (p_id_alumno, p_id_curso, p_texto, p_calificacion);
